import React from "react";
import img from "../../images/meme.jpg";
import { Back, Front } from "./NotFoundElements";

const PageNotFound = () => {
  return (
    <div
      style={{
        position: "relative",
        "text-align": "center",
        color: "white",
        display: "flex",
      }}
    >
      <Back>
        <img
          src={img}
          alt="linus"
          style={{
            height: "100vh",
            width: "100vw",
            "-webkit-background-size": "cover",
            "-moz-background-size": "cover",
            "-o-background-size": "cover",
            "background-size": "cover",
            opacity: 0.5,
          }}
        />
      </Back>
      <Front>
        "404, Page not found!"
        <br /> as the senpai linus said to him self
      </Front>
    </div>
  );
};

export default PageNotFound;
